function checkProps(obj, props) {
  props.forEach(prop => {
    if (obj?.[prop] === undefined) {
      console.log(`%cProps Error : ${prop} is missing in `, 'color: red; font-weight: bold;', obj);
    }
  });
}

module.exports = { checkProps };
